html,
body {
  position: absolute;
  padding: 0;
  margin: 0;
  width: 100%;
  height: 100%;
  overflow: hidden;
}
.infonice-message-box {
  position: absolute;
  /* Stay in place */
  z-index: 20000;
  /* Sit on top */
  left: 0;
  top: 0;
  width: 100%;
  /* Full width */
  height: 100%;
  /* Full height */
  overflow: auto;
  /* Enable scroll if needed */
  background-color: #000000;
  /* Fallback color */
  background-color: rgba(0, 0, 0, 0.4);
  /* Black w/ opacity */
  display: flex;
  align-items: center;
}
.infonice-message-box-body {
  position: relative;
  background-color: #e0e0e0;
  margin: auto;
  /* 15% from the top and centered */
  padding: 10px;
  border: 1px solid #888;
  align-self: center;
  min-width: 250px;
  min-height: 100px;
}
.infonice-message-box-close {
  color: #aaa;
  float: right;
  right: 10px;
  top: 10px;
  position: absolute;
  cursor: pointer;
}
.infonice-message-box-seperator {
  margin: 6px 0 0 0;
  border-top: 1px solid #999;
}
.infonice-message-box-control-area {
  display: flex;
  justify-content: flex-end;
}
.infonice-message-box-control-area > button {
  margin: 4px;
}
/*Overall Layout*/
div.infonice-layout-container {
  position: relative;
}
div.infonice-layout-version {
  z-index: 1000;
  position: absolute;
  left: 0px;
  bottom: 0px;
  font-size: xx-small;
  opacity: 0;
}
div.infonice-layout-version:hover {
  opacity: 0.3;
}
div.infonice-layout-toolbar {
  z-index: 1000;
  position: absolute;
  right: 0px;
  top: 0px;
}
.infonice-layout-toggle {
  position: absolute;
  z-index: 10000;
  top: 10px;
  right: 22px;
  width: 32px;
  height: 32px;
  background-repeat: no-repeat;
  background-size: 32px 32px;
  background-position: center center;
  background-image: url('data:image/png;base64,');
}
.infonice-layout-container:hover .infonice-layout-toggle {
  opacity: 1;
  transition: opacity 0s;
}
.infonice-layout-container:not(hover) .infonice-layout-toggle {
  opacity: 0;
  transition: opacity 0.5s linear;
}
div.infonice-layout-workarea {
  width: 100%;
  height: 100%;
  position: relative;
}
div.infonice-layout-chartarea {
  height: 100%;
  overflow: auto;
  position: relative;
  overflow-x: hidden;
  overflow-y: hidden;
}
div.infonice-layout-panel {
  background-color: lightgray;
  width: 250px;
  height: 100%;
  float: right;
  position: relative;
}
div.infonice-layout-closepanel {
  position: absolute;
  top: 5px;
  right: 2px;
  width: 20px;
  height: 20px;
  background-repeat: no-repeat;
  background-size: 12px 12px;
  background-position: center center;
  background-image: url('data:image/png;base64,');
}
div.infonice-close-dialog {
  position: absolute;
  top: 2px;
  right: 18px;
  width: 16px;
  height: 16px;
  background-repeat: no-repeat;
  background-size: 12px 12px;
  background-position: center center;
  background-image: url('data:image/png;base64,');
}
div.infonice-layout-tablist {
  display: none;
}
div.infonice-layout-tab {
  float: left;
  margin-left: 4px;
  border-top: 2px solid black;
  border-left: 2px solid black;
  border-right: 2px solid black;
}
div.infonice-layout-tab.selected {
  background-color: #e6e6e6;
}
div.infonice-layout-editorlist {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
}
div.infonice-layout-editor {
  background: #e6e6e6;
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
}
div.infonice-layout-editor-title {
  height: 30px;
  background-color: #2f2f2f;
  color: white;
  padding-left: 10px;
  line-height: 30px;
  font-family: 'Segoe UI';
  font-size: 14px;
}
div.infonice-layout-editor-content {
  position: absolute;
  width: 100%;
  top: 30px;
  bottom: 0px;
}
line.infonice-smallmultiple-vseparator {
  stroke: lightgray;
  stroke-width: 1;
}
line.infonice-smallmultiple-hseparator {
  stroke: lightgray;
  stroke-width: 1;
}
.nav-bar {
  font-family: 'Segoe UI';
  font-size: 12px;
  padding: 4px 10px;
}
.nav-bar select {
  border: 0;
  height: 24px;
  font-size: 12px;
}
.nav-bar a {
  color: steelblue;
  cursor: pointer;
  text-decoration: none !important;
}
.nav-bar a:hover {
  color: rebeccapurple;
  cursor: pointer;
}
.settings-sections {
  margin-left: 6px;
}
.setting-item-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.setting-item-list-item {
  margin: 2px 8px;
  padding: 2px;
  list-style: none;
}
.setting-item-title {
  display: inline-block;
  width: 120px;
  font-family: 'Segoe UI';
  font-size: 12px;
  color: #777;
}
.btn-reset-colors {
  margin-left: 8px;
  font-size: 12px;
  padding: 4px;
  border: 1px solid #aaa;
}
